Envy allows for specifying a wide variety of dependency types: { config, lib, pkgs, ... }:
{ pluginRegistry = { # Inter-plugin dependencies; the items should either be `pluginRegistry` # attribute names or vim plugin derivations. neosnippet-snippets.dependencies = [ "neosnippet-vim" ]; # Specifies that a plugin needs external executables from the given # packages made available in neovim's $PATH. ale.binDeps = with pkgs; [ bash shellcheck shfmt ]; # Ensures that the specified Lua modules will be made available in # neovim's LUA_PATH/LUA_CPATH, meaning that the main neovim process can # load them for in-process Lua plugins and scripts to use. "Shados/precog.nvim".luaDeps = ps: with ps; [ luafilesystem ]; # Flags a plugin as being a 'remote' plugin requiring a plugin host for a # specific language (here, Python 3). denite-nvim.remote.python3 = true; # Pulls in plugin-host-language dependencies. # Automatically implies `remote.python3 = true;`. aPythonPlugin.remote.python3Deps = ps: with ps; [ requests ]; };
} Inter-plugin dependencies also determine the order in which Vim plugins are loaded at Vim run-time (by vim-plug ). There are additionally two "soft" dependency options (before and after, both of which take lists of plugin names only), that change how plugins are ordered if both are enabled, but does not cause the "dependency" to be enabled if the "dependent" plugin is, e.g.: { config, lib, pkgs, ... }:
{ pluginRegistry = { # vim-devicons needs to be loaded after these plugins, if they # are being used, as per its installation guide. # Both `after` and `before` can be specified as either `pluginRegistry` # attribute names or vim plugin derivations. vim-devicons.after = [ "nerdtree" "vim-airline" "ctrlp-vim" "powerline/powerline" "denite-nvim" "unite-vim" "lightline-vim" "vim-startify" "vimfiler" "vim-flagship" ]; };
} It should be noted that lazy-loaded plugins don't fully respect ordering options, and don't trigger lazy-loading of dependencies. Either ensure dependencies aren't also being lazy-loaded, or put them behind the same lazy-load triggers as their dependents.

