An attribute set describing the available/known neovim plugins. Type: attribute set of (submodule) Default: { } Example: (let inherit (pkgs) vimPlugins; pins = import ./niv/sources.nix { };
in { nvim-moonmaker = { enable = true; # Build plugin derivation from a Niv source pins attribute set source = config.sn.programs.neovim.lib.buildVimPluginFromNiv pins "nvim-moonmaker"; # Decide whether or not to load at run-time based on the result of # a VimL expression condition = "executable('moonc')"; }; vim-auto-save = { enable = true; source = vimPlugins.vim-auto-save; # Lazily load on opening a tex file for = "tex"; }; nerdtree = { enable = true; source = vimPlugins.nerdtree; # Lazily load on command usage on_cmd = "NERDTreeToggle"; extraConfig = '' " Prettify NERDTree let NERDTreeMinimalUI = 1 let NERDTreeDirArrows = 1 ''; }; # A "path" plugin built from a source path "nginx.vim" = { enable = true; source = ../nvim-files/local/nginx; }; # A "local" plugin not directly managed by Nix, merely loaded at nvim # run-time from the specified directory "devplugin" = { enable = true; dir = "/home/shados/projects/vim/devplugin"; }; # A plugin configured but not enabled vim-devicons = { source = vimPlugins.vim-devicons; # vim-devicons needs to be loaded after these plugins, if they # are being used, as per its installation guide after = [ "nerdtree" "vim-airline" "ctrlp-vim" "powerline/powerline" "denite-nvim" "unite-vim" "lightline-vim" "vim-startify" "vimfiler" "vim-flagship" ]; };
})

