Usage as a standalone module is slightly more complicated, and is most easily done by use of the configuredNeovimModule in Envy's lib module: { nixpkgs ? import <nixpkgs> { } }:
let envy = (builtins.fetchgit { url = https://github.com/Shados/envy; ref = "master"; }); envyLib = (import "${envy}/lib.nix" { inherit nixpkgs; }); envyModule = envyLib.configuredNeovimModule { nvimConfig = { config, lib, pkgs, ... }: { # Envy module config here pluginRegistry = { ... }; }; }
in
nixpkgs.mkShell { ... buildInputs = [ envyModule.wrappedNeovim ... ];
}

